const Recommend = (answers) => {
    const url = 'http://localhost:5000/food/analyze/?p1='+String(answers[0])+'&p2='+String(answers[1])+'&p3='+String(answers[2])+'&p4='+String(answers[3]);
    const res = fetch(url, {method: 'get'})
        .then(res => {
            return res.json();
        })
        .then(data => {
            console.log(data);
        })
    return ( {res}
     );
}
 
export default Recommend;
